- uid: "com.google.datastore.admin.v1.ExportEntitiesRequestOrBuilder.getOutputUrlPrefix()"
  id: "getOutputUrlPrefix()"
  parent: "com.google.datastore.admin.v1.ExportEntitiesRequestOrBuilder"
  langs:
  - "java"
  name: "getOutputUrlPrefix()"
  nameWithType: "ExportEntitiesRequestOrBuilder.getOutputUrlPrefix()"
  fullName: "com.google.datastore.admin.v1.ExportEntitiesRequestOrBuilder.getOutputUrlPrefix()"
  overload: "com.google.datastore.admin.v1.ExportEntitiesRequestOrBuilder.getOutputUrlPrefix*"
  type: "Method"
  package: "com.google.datastore.admin.v1"
  summary: "\n Required. Location for the export metadata and data files.\n\n The full resource URL of the external storage location. Currently, only\n Google Cloud Storage is supported. So output_url_prefix should be of the\n form: <code>gs://BUCKET_NAME[/NAMESPACE_PATH]</code>, where <code>BUCKET_NAME</code> is the\n name of the Cloud Storage bucket and <code>NAMESPACE_PATH</code> is an optional Cloud\n Storage namespace path (this is not a Cloud Datastore namespace). For more\n information about Cloud Storage namespace paths, see\n <a href=\"https://cloud.google.com/storage/docs/naming#object-considerations\">Object name\n considerations</a>.\n\n The resulting files will be nested deeper than the specified URL prefix.\n The final output URL will be provided in the\n <xref uid=\"\" data-throw-if-not-resolved=\"false\">google.datastore.admin.v1.ExportEntitiesResponse.output_url</xref>\n field. That value should be used for subsequent ImportEntities operations.\n\n By nesting the data files deeper, the same Cloud Storage bucket can be used\n in multiple ExportEntities operations without conflict.\n \n\n <code>string output_url_prefix = 4 [(.google.api.field_behavior) = REQUIRED];</code>"
  syntax:
    content: "public abstract String getOutputUrlPrefix()"
    return:
      type: "java.lang.String"
      description: "The outputUrlPrefix."
